import { Component } from '@angular/core';

@Component({
  selector: 'app-reports',
  templateUrl: './reports.component.html',
  styleUrls: ['./reports.component.css']
})
export class ReportsComponent {

  selectedType = '';
  startDate = '';
  endDate = '';

  reports = [
    { type: 'Sales', date: new Date(), details: 'Order #1234', amount: 5000 },
    { type: 'Users', date: new Date(), details: 'New user registered', amount: 0 },
    { type: 'Traffic', date: new Date(), details: '500 page views', amount: 0 },
  ];

  reportSummary = {
    sales: 5000,
    users: 1,
    visits: 500,
  };

  filter = {
    name: '',
    status: ''
  };

  // Filtered data shown
  filteredReports = [...this.reports];

  applyFilter() {
    this.filteredReports = this.reports.filter(report => {
      const matchesName = this.filter.name
        ? report.name.toLowerCase().includes(this.filter.name.toLowerCase())
        : true;

      const matchesStatus = this.filter.status
        ? report.status === this.filter.status
        : true;

      return matchesName && matchesStatus;
    });
  }
}
